import React from "react";
function MovieList(props) {
  return (
    <div>
      {props.movies.map((movie) => {
        return (
          <h3 key={movie.id} onClick={this.movieClicked(movie)}>
            {movie.title}
          </h3>
        );
      })}
    </div>
  );
}
export default MovieList;
